        "body_html": " It's hard to believe, but we're already celebrating a year in our new and expanded store—just in time for Champagne season. Naturally, we're popping some incredible bottles for our second annual Skurnik Champagne Night. Please join us for a very special walk-around tasting on Thursday, October 5th from 5:30-7:30pm as we open more than 30 stunners from the 2023 Skurnik Champagne portfolio. You'll also get an early chance to place orders from our annual sale, which will be offered to the general public the following day. Featured producers will include Chartogne-Taillet, Pierre Peters, Vilmart &amp; Fils, A. Margaine, Marc Hebrart, Famille Moussé and more. Your $40 ticket will be converted to a $20 gift card that can be used on any future purchase. Light snacks will accompany the wines, and all featured wines will be offered at a special event discount. Space is limited, so don't wait to grab your ticket. We hope you can join us Thursday, October 5 from 5:30 to 7:30pm on our mezzanine for this exciting Champagne tasting. ",
