    //     "body_html": " Happily, many wine drinkers have already moved beyond the notion that sparkling wines are only for celebrations. In fact, they’re arguably the most versatile category of all wines! And you don’t need a Champagne budget to enjoy quality bubbles year-round. However, there are so many factors when it comes to sparkling wines, even experienced wine lovers can’t always pinpoint why they like the bubblies they like, or feel confident finding new favorites. Flatiron team member and Wine Minx® Annie Edgerton, DWSET, CS, is thrilled to take you on a journey of all things fizzy. She’ll walk you through a brief history of this “accidental” creation, outline the different ways sparkling wines are made, cover global styles, delve into the best grape varieties, discuss the influence of dosage, aging potential, importance (or not) of terroir, vintage vs. non-vintage (hint, neither one is necessarily “better,”) and many more factors. Annie truly has a deep love of all things bubbly and is going to share five favorite bottles with you as she illuminates the wonders and joys of secondary fermentation. This class will begin at 6:00pm on Tuesday, September 26 and run for approximately 90 minutes as we taste five wines. Wines discussed in class will be available for purchase with a discount available to attendees only. Seating is limited. ",
