        "body_html": "Farming the Grand Cru of Verzenay (famous as the main source for Roederer's Cristal) since 1885 and now the family bottles their own wine. Farming is organic with plowing done by horses. Fermentation is in old Chassagne Montrachet barrels and reserve wine is from an old solera. The style is oxidative and powerful Pinot noir, but the cut of the chalky north-facing site. Zero dosage for even more linear structure. ",
