        "body_html": "Even at 23 years old the wine is still imbued with freshly picked pears, peaches and apricots. But the toasty caramel cookie, butter, silky, almost flan like texture point to its age. While drinking great now, it will continue to develop for many more years with proper storage. The Verzenay chalk and Pinot really stand out through the power and laser like finish. ",
