        "body_html": " Krug's latest release, based on the 2014 vintage -- the third in a string of miracle vintages -- is a gorgeous, ready-to-drink gem. This half-bottle size is perfect for starting a meal for two, or accompanying a meal, or finishing a meal... Yes, it's perfect! The Wine Advocate loves it to: \"Krug's NV Grande Cuvée 170ème Édition is based on the 2014 vintage, complemented by some 45% reserve wines dating back to 1998, with the house drawing on, among many others, 2013 for structure and 2012 and 2003 for generosity. Opening in the glass with aromas of pastry cream, dried fruits, pear, warm spices, freshly baked bread and vanilla pod, it's medium to full-bodied, pillowy and fine-boned, with excellent concentration, racy acids and a precise, chiseled profile. But if the latter adjective could be applied to the 2013-base 169ème édition equally felicitously, the 2014-base 170ème is more giving and less tightly wound out of the gates and will offer more demonstrative drinking young.\" ",
