        "body_html": "Do you want a hug? A glass of Vilmart might just be the next best thing. Powerful yet yielding, comforting and in control, this wine has the ability to transport you to a better place. A robust 70% Chardonnay with 30% Pinot Noir from 50% 2016 50% 2015-2014 in the Village of Rilly la Montagne 1er Cru. The wine sees an extensive 30+ months on sur latte, after 10 months in large used barrel, allowing the edged to seamlessly meld and concentrate the fruit and mineral into a mouthwatering decadent experience. ",
